import React, { Component } from "react";
import styled, { css } from "styled-components";
import CupertinoButtonInfo from "./CupertinoButtonInfo";

function Untitled(props) {
  return (
    <>
      <EllipseStackStack>
        <EllipseStack>
          <svg
            viewBox="0 0 765.21 338.18"
            style={{
              top: 196,
              left: 0,
              width: 765,
              height: 385,
              position: "absolute"
            }}
          >
            <ellipse
              stroke="rgba(0,0,0,1)"
              strokeWidth={2}
              cx={383}
              cy={169}
              rx={382}
              ry={168}
            ></ellipse>
          </svg>
          <Rect></Rect>
          <Rect2></Rect2>
        </EllipseStack>
        <CareCalories>CareCalories.</CareCalories>
      </EllipseStackStack>
      <WellcomeStackRow>
        <WellcomeStack>
          <Wellcome>WELLCOME</Wellcome>
          <Wellcome1>WELLCOME</Wellcome1>
          <Wellcome2>WELLCOME</Wellcome2>
        </WellcomeStack>
        <CupertinoButtonInfo
          style={{
            height: 58,
            width: 432,
            marginLeft: 439,
            marginTop: 50
          }}
        ></CupertinoButtonInfo>
      </WellcomeStackRow>
    </>
  );
}

const Rect = styled.div`
  top: 0px;
  width: 1095px;
  height: 267px;
  position: absolute;
  border-width: 2px;
  border-color: #000000;
  transform: rotate(-3.00deg);
  left: 557px;
  border-style: solid;
`;

const Rect2 = styled.div`
  top: 197px;
  left: 231px;
  width: 475px;
  height: 268px;
  position: absolute;
  background-color: rgba(255,255,255,1);
`;

const EllipseStack = styled.div`
  top: 0px;
  left: 0px;
  width: 1652px;
  height: 581px;
  position: absolute;
`;

const CareCalories = styled.span`
  font-family: ADLaM Display;
  top: 549px;
  left: 1110px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: rgba(89,123,70,1);
  height: 78px;
  width: 407px;
  font-size: 64px;
`;

const EllipseStackStack = styled.div`
  width: 1652px;
  height: 627px;
  margin-top: -197px;
  margin-left: -235px;
  position: relative;
`;

const Wellcome = styled.span`
  font-family: System;
  top: 0px;
  left: 0px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: rgba(89,123,70,1);
  height: 78px;
  width: 407px;
  font-size: 64px;
`;

const Wellcome1 = styled.span`
  font-family: Helvetica;
  top: 69px;
  left: 60px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: rgba(89,123,70,1);
  height: 78px;
  width: 407px;
  font-size: 64px;
`;

const Wellcome2 = styled.span`
  font-family: ADLaM Display;
  top: 108px;
  left: 116px;
  position: absolute;
  font-style: normal;
  font-weight: 400;
  color: rgba(89,123,70,1);
  height: 104px;
  width: 437px;
  font-size: 72px;
`;

const WellcomeStack = styled.div`
  width: 553px;
  height: 212px;
  position: relative;
`;

const WellcomeStackRow = styled.div`
  height: 212px;
  flex-direction: row;
  display: flex;
  margin-top: 29px;
  margin-right: -58px;
`;

export default Untitled;
